import React from 'react';
import { Modal, Button, Space, Typography, Row, Col } from 'antd';

const { Title, Text } = Typography;

const WarningModal = ({ label = '', type = 'info', title = 'title' }) => {
  function info() {
    Modal.info({
      title: <Title level={3}>{title}</Title>,
      content: (
        <>
          <Row justify='center' type='flex'>
            <Col span={12} style={{ backgroundColor: 'red' }} flex={2}>
              <Button type='primary'>Soy nuevo</Button>
            </Col>
          </Row>
          <Row justify='center' style={{ backgroundColor: 'red' }}>
            <Col span={12}>
              <Button type='link'>Ya tengo cuenta</Button>
            </Col>
          </Row>
        </>
      ),
      onOk() {},
    });
  }

  function success() {
    Modal.success({
      content: 'some messages...some messages...',
    });
  }

  function error() {
    Modal.error({
      title: 'This is an error message',
      content: 'some messages...some messages...',
    });
  }

  function warning() {
    Modal.warning({
      title: 'This is a warning message',
      content: 'some messages...some messages...',
    });
  }
  return (
    <div>
      <Space>
        {type === 'info' && (
          <Button type='primary' onClick={info}>
            {' '}
            {label ? label : 'Info'}
          </Button>
        )}
        {type === 'success' && (
          <Button type='primary' onClick={success}>
            {' '}
            {label ? label : 'Success'}
          </Button>
        )}

        {type === 'error' && (
          <Button type='primary' onClick={error}>
            {' '}
            {label ? label : 'Error'}
          </Button>
        )}

        {type === 'warning' && (
          <Button type='primary' onClick={warning}>
            {' '}
            {label ? label : 'Warning'}
          </Button>
        )}
      </Space>
    </div>
  );
};

export default WarningModal;
